  true,\n\t\"url\": null,\n\t\"notes\": \"A mooring line for an oceanographic buoy
  system includes four sections. The first section is a protected cable that is connectable
  to the buoy. The second section is an energy absorbing cable. The third section
  is a weighted cable. The fourth section is a buoyant cable that is connectable to
  the anchor. The four sections are connected in series by smooth transitional connections.
  When the mooring line is deployed, it has an inverse catenary lay.\",\n\t\"license_title\":
